import React, {useState} from 'react';

const AddProject = () => {
    const [description, setDescription] = useState("");

    return(
        <div>
            <h1>Add Project</h1>
            <form>
                <input type="text"
                    value={description}
                    onChange={e => setDescription(e.target.value)}
                />
                <button>Add</button>
            </form>
        </div>
    );
};

